resources.string:
Вспомните, где вы побывали. Посмотрите на карте свои фото и сохраненные общие снимки, у которых есть сведения о месте съемки. Для определения местоположения могут использоваться:

 • данные GPS-модуля камеры;
 • найденные ориентиры.

Фотографии и видео в личной папке, которые не были скопированы в облако, не сохранятся, если вы:

 • смените устройство;
 • сбросите настройки устройства;
 • удалите приложение "Google Фото".
